(2, 'http://maps.google.co.id/maps?hl=id&tab=wl', ' Google Maps ', '', '', 0, 0),
(3, 'http://www.youtube.com/?gl=ID&tab=w1', 'YouTube', 'Nikmati video dan musik yang Anda suka, upload konten asli, dan bagikan kepada teman, keluarga, dan dunia di YouTube.', 'video, berbagi, ponsel kamera, ponsel video, gratis, upload', 0, 0),
