(6, 'https://drive.google.com/?tab=wo', 'Sambutlah Google Drive – Satu tempat untuk semua file Anda', 'Google Drive merupakan cara gratis untuk menyimpan cadangan file yang mudah dijangkau dari telepon, tablet, atau komputer. Mulai dengan penyimpanan Google sebesar 15 GB – gratis.', '', 0, 0),
